import axios from 'axios';

const API_KEY = 'AIzaSyAKlTOimxiUY4mCFlulFLmXFYlt5x6TOr8';  y
export async function fetchYouTubeRecommendations(searchQuery) {
    const URL = `https://www.googleapis.com/youtube/v3/search?part=snippet&q=${searchQuery}&type=video&key=${API_KEY}&maxResults=5`;

    try {
        const response = await axios.get(URL);
        const videos = response.data.items;
        return videos;
    } catch (error) {
        console.error("Error fetching YouTube videos", error);
    }
}
